		/**
		 * Determine's which version of IE is in use
		 * @returns {Number} IE version number or -1 if not IE
		 */
		function getInternetExplorerVersion() {
			var rv = -1;
			if (navigator.appName == 'Microsoft Internet Explorer') {
				var ua = navigator.userAgent;
				var re = new RegExp("MSIE ([0-9]{1,}[\.0-9]{0,})");
				if (re.exec(ua) != null)
					rv = parseFloat(RegExp.$1);
			} else if (navigator.appName == 'Netscape') {
				var ua = navigator.userAgent;
				var re = new RegExp("Trident/.*rv:([0-9]{1,}[\.0-9]{0,})");
				if (re.exec(ua) != null)
					rv = parseFloat(RegExp.$1);
			}
			return rv;
		}
		
		/**
		 * Custom Center Text Function for jsPDF
		 * @param {Object} API jsPDF API Object
		 */
		(function (API) {
			API.myText = function (txt, options, x, y) {
				options = options || {};
				if (options.align == "center") {
					var fontSize = this.internal.getFontSize();
					var pageWidth = this.internal.pageSize.width;
					txtWidth = this.getStringUnitWidth(txt) * fontSize / this.internal.scaleFactor;
					x = (pageWidth - txtWidth) / 2;
					if (options.offset) {
						x += options.offset;
					}
					x = Math.round(x);
				}
				this.text(txt, x, y);
			}
		})(jsPDF.API);
		
		/**
		 * Pads the Digits shown
		 * @param   {[[Type]]} n           [[Description]]
		 * @param   {[[Type]]} totalDigits [[Description]]
		 * @returns {[[Type]]} [[Description]]
		 */
		var padDigits = function (n, totalDigits) {
			n = n.toString();
			var pd = '';
			if (totalDigits > n.length) {
				for (i = 0; i < (totalDigits - n.length); i++) {
					pd += '0';
				}
			}
			return pd + n.toString();
		}
